import './App.css';
import { BrowserRouter } from 'react-router-dom';
import { Routes, Route } from 'react-router-dom';
import Nav from './Nav';


function App() {
  return (
    <div className="">
      <BrowserRouter>
      <Nav/>
        <Routes>
          <Route >
            <Route path="/" element={<h1>Product listing component</h1>} />
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
